import { Router } from '../routes'
const queryString = require('query-string');


class AboutUs extends Component {


    componentDidMount() {
        const parased = queryString.parse(location.search);
        console.log(parased)
    }

    handleClick = () => {
        Router.pushRoute('/about?search=dummy')
    }


    render() {
        return (
            <div>
                this is about page
                <button type="button" onClick={this.handleClick}>set</button>
            </div>
        );
    }
}

export default AboutUs;
